{"query":"mutation ReadAssetMutation(
  $read: AssetReadInput!
) {
  assetRead(read: $read) {
    error {
      message
      type
    }
    reference {
      shortlistId
      readingHistoryId
      shortlistItem {
        assetId
        id
      }
      assetEdge {
        cursor
        node {
          ...ShortlistAssetFragmentFragment
          id
        }
      }
    }
  }
}

fragment ShortlistAssetFragmentFragment on Asset {
  asset {
    headlines {
      headline
    }
  }
  assetType
  featuredImages {
    landscape3x2 {
      ...ImageFragment
    }
    square1x1 {
      ...ImageFragment
    }
  }
  id
  urls {
    canonical {
      path
      brand
    }
    published {
      brisbanetimes {
        path
      }
      canberratimes {
        path
      }
      smh {
        path
      }
      theage {
        path
      }
      watoday {
        path
      }
    }
  }
}

fragment ImageFragment on Image {
  data {
    animated
    aspect
    autocrop
    cropWidth
    id
    mimeType
    offsetX
    offsetY
    zoom
  }
}
","variables":{"read":{"assetId":"gunkqm","deviceId":"3e41f31b-13ca-40f5-9501-73ede860b9bc"}}}
